import Add from "../add/Add";
import Birthday from "../birthday/birthday";
import OnlineFriend from "../onlineFriend/OnlineFriend";
import "./rightbar.css";

export default function Rightbar() {
  return (
    <div className="rightbar">
      <div className="rightbarWrapper">
        <Birthday />
        <Add />
        <OnlineFriend />
      </div>
    </div>
  );
}
